import React from 'react'
import { loginRequest } from '../../AuthenticationFolder/authConfig'
import { callForEvent } from './GraphCalls';
import { useState } from 'react';

export async function GetEvent (data, instance, accounts){
    const [event, setEvent] = useState();
    const request = {
        ...loginRequest,
        account: accounts[0]
    };  
    instance.acquireTokenSilent(request).then((res) => {
        data.map((user) => {
            callForEvent(res.accessToken, user.userPrincipalName, user.accountEnabled).then(event => {
              setEvent(event);
            })
        })
    })
    return event
}
